function resetForm() {
    const dataLength = data.length;
    document.getElementById("searchForm").reset(); 
    var homeCounter = document.getElementById("homeCounter");
    var text = document.createTextNode(dataLength);
    homeCounter.appendChild(text);

    // Disable main button
    let mainButton = document.getElementById("search-button"); 
    mainButton.disabled = true;

    // Check if cookies are accepted

    let checkCookies =  localStorage.getItem("cookies");
    
    if (checkCookies != 'true') {
        let cookiesMessage = document.getElementById('cookiesMessage');
        cookiesMessage.hidden = false;
    }

    // Retrieve locaStorage and refresh counter
    const favs = localStorage.getItem("favorites");
    // convert string to valid object
    
    let headerFavs = document.getElementById("headerFavs");
    let number = 0;
    if (favs == null) {number = 0;}
    else {favArray = JSON.parse(favs);number = favArray.length;}
    document.getElementById("favNumber").innerHTML = number;
    if (number > 0) {
        headerFavs.classList.remove("inactive");
        headerFavs.classList.add("active");
    }
    else {
        headerFavs.classList.add("inactive");
        headerFavs.classList.remove("active"); 
    }
}

